		}

		string resultStr = null;
		bool head_flag = false;
		bool end_flag = false;
		public void DataReceived(byte[] data)
		{
			buffer.AddendData(data);
			var newdata = buffer.GetDeleteData(-1);
			resultStr = System.Text.Encoding.ASCII.GetString(data);
			if (resultStr.Contains("HEAD") && resultStr.Contains("END"))
			{
				//删除start和end
				resultStr = resultStr.Replace("HEAD", "");
				resultStr = resultStr.Replace("END", "");
				head_flag = true;
				end_flag = true;
			}
			if (head_flag && end_flag)
			{
				
					if (resultStr.ToInt() < 45)
					{
						resultDouble = arr_30_rate;
					}
					else if (resultStr.ToInt() < 70)
					{
						resultDouble = arr_60_rate;
					}
					else if (resultStr.ToInt() < 85)
					{
						resultDouble = arr_80_rate;
					}
					else if (resultStr.ToInt() < 105)
					{
						resultDouble = arr_90_rate;
					}
					else if (resultStr.ToInt() < 135)
					{
						resultDouble = arr_120_rate;
					}
					else if (resultStr.ToInt() < 165)
					{
						resultDouble = arr_150_rate;
					}
					else if (resultStr.ToInt() < 195)
					{
						resultDouble = arr_180_rate;
					}
					else if (resultStr.ToInt() < 225)
					{
						resultDouble = arr_210_rate;
					}
					else if (resultStr.ToInt() < 255)
					{
						resultDouble = arr_240_rate;
					}
					else if (resultStr.ToInt() < 285)
					{
						resultDouble = arr_270_rate;
					}
					else if (resultStr.ToInt() < 310)
					{
						resultDouble = arr_300_rate;
					}
					else if (resultStr.ToInt() < 340)
					{
						resultDouble = arr_320_rate;
					}
			}
			if (resultStr.Contains("DISCONNECT"))
			{
				//删除start和end
				UpdateButtonText("启动");
				this.timer1.Stop();
				MessageBox.Show("设备已断开", "WARNING", MessageBoxButtons.OK, MessageBoxIcon.Information);
			}

			this.chart.Titles[0].Text = string.Format("心电\"波形\"显示") + "   当前心率：" + resultStr;

			head_flag = false;
			end_flag = false;

		}

		public void UpdateButtonText(string text)
		{
			// 检查是否需要跨线程调用
			if (this.Chart_Btn.InvokeRequired)
			{
				// 如果需要，使用Invoke方法在创建控件的线程上执行操作
				this.Chart_Btn.Invoke(new Action<string>(UpdateButtonText), new object[] { text });
			}
			else
			{
				// 如果不需要，直接更新按钮的文本
				this.Chart_Btn.Text = text;
			}
		}
		public void DataHandler(List<object> arg)
		{
			if (buffer.HasChanged())
			{
				///数据处理
				var newdata = buffer.GetDeleteData(-1);
				var datas = Unpack(newdata); //如果传输数据有打包则需要解包

				//波形数据更新
				foreach (var nums in datas)
				{
					AppendData(nums);
					
				}
			}
		}


